import * as React from "react";
import { View, Image, StyleSheet, Pressable, Text } from "react-native";
import { TextInput as RNPTextInput } from "react-native-paper";
import { useNavigation } from "@react-navigation/native";
import { Border, Color, FontFamily, Padding, FontSize } from "../GlobalStyles";

const Landing = () => {
  const navigation = useNavigation();

  return (
    <View style={styles.landing}>
      <View style={styles.beautifulSplash}>
        <Image
          style={[styles.mmuHotel21, styles.mmuHotel21Layout]}
          resizeMode="cover"
          source={require("../assets/mmu-hotel2-1.png")}
        />
        <Image
          style={[styles.swimmu1Icon, styles.iconLayout]}
          resizeMode="cover"
          source={require("../assets/swimmu-1.png")}
        />
        <Image
          style={[styles.mmu11Icon, styles.iconLayout]}
          resizeMode="cover"
          source={require("../assets/mmu1-1.png")}
        />
        <Image
          style={[styles.mmustud1Icon, styles.iconPosition]}
          resizeMode="cover"
          source={require("../assets/mmustud-1.png")}
        />
        <Image
          style={[styles.mmuhotel1Icon, styles.iconPosition]}
          resizeMode="cover"
          source={require("../assets/mmuhotel-1.png")}
        />
        <Image
          style={[styles.whatsappImage20230119At9, styles.whatsappPosition]}
          resizeMode="cover"
          source={require("../assets/whatsapp-image-20230119-at-943-1.png")}
        />
        <Image
          style={[styles.whatsappImage20230119At91, styles.whatsappPosition]}
          resizeMode="cover"
          source={require("../assets/whatsapp-image-20230119-at-943-2.png")}
        />
      </View>

{/* Form..................................................... */}

      <View style={[styles.registrationNumberWrapper, styles.registrationFlexBox]}>
        <RNPTextInput
          placeholder="Registration number"
          theme={{
            fonts: { regular: { fontFamily: "", fontWeight: "Regular" } },
            colors: { text: "#000" },
          }}
        />
      </View>
      <View style={[styles.password, styles.registrationFlexBox]}>
        <RNPTextInput
          placeholder="Password"
          theme={{
            fonts: { regular: { fontFamily: "", fontWeight: "Regular" } },
            colors: { text: "#000" },
          }}
        />
      </View>


      <Pressable
        style={[styles.registration, styles.registrationFlexBox]}
        onPress={() =>
          navigation.navigate("BottomTabsRoot", { screen: "Feed" })
        }
      >
        <Text style={[styles.continue, styles.continueClr]}>Continue</Text>
      </Pressable>


      <Image
        style={styles.vibeIcon} resizeMode="cover" source={require("../assets/vibeicon.png")}
      />
      <View style={styles.university}>
        <Text
          style={[styles.multimediaUniversity, styles.continueTypo]} >{`Multimedia University`}</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  mmuHotel21Layout: {
    width: 125,
    left: 0,
  },
  iconLayout: {
    width: 120,
    left: 131,
  },
  iconPosition: {
    left: 258,
    width: 125,
    position: "absolute",
  },
  whatsappPosition: {
    borderTopRightRadius: Border.br_mini,
    position: "absolute",
  },
  registrationFlexBox: {
    position: "absolute"
  },
  continueTypo: {
    fontFamily: FontFamily.interBold,
    fontWeight: "700",
  },
  mmuHotel21: {
    height: 200,
    borderBottomRightRadius: Border.br_mini,
    position: "absolute",
    top: 0,
  },
  swimmu1Icon: {
    height: 100,
    borderBottomLeftRadius: Border.br_mini,
    top: 0,
    borderBottomRightRadius: Border.br_mini,
    position: "absolute",
  },
  mmu11Icon: {
    top: 108,
    borderRadius: Border.br_mini,
    height: 200,
    position: "absolute",
  },
  mmustud1Icon: {
    borderBottomLeftRadius: Border.br_mini,
    top: 0,
    height: 200,
  },
  mmuhotel1Icon: {
    top: 207,
    height: 199,
    borderTopLeftRadius: Border.br_mini,
  },
  whatsappImage20230119At9: {
    top: 209,
    height: 197,
    width: 125,
    left: 0,
  },
  whatsappImage20230119At91: {
    top: 316,
    height: 90,
    borderTopLeftRadius: Border.br_mini,
    width: 120,
    left: 131,
  },
  beautifulSplash: {
    left: 6,
    width: 383,
    height: 406,
    top: 0,
    position: "absolute",
  },
  registrationNumberWrapper: {
    top: 550,
    width: 300,
    backgroundColor: Color.whitesmoke_200,
    borderRadius: Border.br_xl,
    left: 43,
  },
  password: {
    top: 620,
    width: 300,
    left: 43,
  },
  continue: {
    textAlign: "left",
    fontWeight: "700",
  },
  registration: {
    top: 720,
    backgroundColor: Color.steelblue_200,
    paddingHorizontal: 118, paddingVertical: 10,
    alignItems: "center",
    borderRadius: Border.br_xl,
    left: 43,
  },
  vibeIcon: {
    top: 391,
    left: 176,
    width: 40,
    height: 70,
    position: "absolute",
  },
  multimediaUniversity: {
    fontSize: 30,
    color: Color.black,
    width: 179,
    height: 65,
    textAlign: "left",
  },
  university: {
    top: 461,
    left: 107,
    alignItems: "flex-end",
    justifyContent: "flex-end",
    position: "absolute",
  },
  landing: {
    backgroundColor: Color.white,
    flex: 1,
    width: "100%",
    height: 852,
    overflow: "hidden",
  },
});

export default Landing;
